import React from 'react';
import styles from"./Profile.module.css";
import { Col, Row } from 'react-bootstrap';
import Myposts from './Myposts/Post/Myposts';


const Profile = () =>{
    return(
        <Col xs='7' className={styles.content}>
            <Row>
                <Col xs='12'>
                    <img className={styles.wallper} src='london.jpg'></img>
                </Col>
                <Col xs='12'>ava+description</Col>
                <Col xs='12'>my/new posts</Col>
                <Myposts />
            </Row>
        </Col>
    )
}
export default Profile;
